import "./ExpenseItem.css";

function ExpenseItem() {
    const expenceDate = new Date(2023, 8, 18).toDateString();
    const expenceTitle = 'Car Insurence';
    const expenceAmout = 595.50;
    return (
        <div className="expense-item">
        <div>{expenceDate}</div>
        <div className="expense-item__description">
            <h2>{expenceTitle}</h2>
            <div className="expense-item__price">{'\u20B9'+ ' ' + expenceAmout}</div>
        </div>
        </div>
    );
}

export default ExpenseItem;
